import React, { Component } from 'react'
import LoginForm from '../LoginForm/LoginForm'
export class Login extends Component {
    render() {
        return (
            <div>
                <h1>This is Login Page</h1>
                <LoginForm />
            </div>
        )
    }
}

export default Login
